import { Component } from '@angular/core';
import { CredentialModel } from 'src/app/Models/Authenticated/CredentilsModel';
import { GetUserModel } from 'src/app/Models/Users/GetUserModel';
import { AutorizationService } from 'src/app/services/Authorization/autorization.service';
import { UserServiceService } from 'src/app/services/Users/user-service.service';
import { FormControl, Validators, FormGroup, FormBuilder, AbstractControl } from '@angular/forms';


@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.scss']
})
export class LoginComponent {
  userCredentials: CredentialModel = { email: '', password: '' }
  private porfile : GetUserModel | null = null;
  loginForm: FormGroup | undefined;
 constructor(
  private autorizationService: AutorizationService,
  private userService: UserServiceService,
  private formBuilder: FormBuilder
 ){
  this.buildForm();
 }

private buildForm(){
  this.loginForm = this.formBuilder.group({
    email: ['', [Validators.required, Validators.email]],
    password: ['', Validators.required]
  })
}
get email() {
  return this.loginForm.get('email');
}
get password() {
  return this.loginForm.get('password');
}
 login() {
  this.userCredentials.email = this.email();
  this.userCredentials.password = this.password();
  console.log("CREDENCIALES",this.userCredentials)
  this.autorizationService.login(this.userCredentials)
    .subscribe(response => {
      console.log(response);
    })
}

getProfile(){
  this.autorizationService.getProfile()
  .subscribe(response =>{
    this.porfile = response.data;
  });
}

onLogin(){
  if (this.loginForm?.invalid) {
    return;
  }
    this.login()
}
}
<div class="container">
  <div class="logo-container">
    <img src="../../../../assets/LogoSinFondo.png" alt="Logo de la aplicación" class="logo-image">
  </div>
  <h2 style="font-family: 'Courier New', Courier, monospace;">Login</h2>
  <form (ngSubmit)="onLogin()" [formGroup]="loginForm">
    <div class="form-group">
      <label style="font-family: 'Courier New', Courier, monospace;" for="email">Correo Electrónico</label>
      <input type="email" id="email" name="email" class="form-control" formControlName="email" required>
      <p class="error-message" *ngIf="loginForm.controls['email'].invalid && loginForm.controls['email'].touched">
        El correo electrónico es requerido.
      </p>
    </div>
    <div class="form-group">
      <label style="font-family: 'Courier New', Courier, monospace;" for="password">Contraseña</label>
      <input type="password" id="password" name="password" class="form-control" formControlName="password"
        required>
      <p class="error-message" *ngIf="loginForm.controls['password'].invalid && loginForm.controls['password'].touched">
        La contraseña es requerida.
      </p>
    </div>

    <div class="form-group">
      <div class="text-center">
        <a routerLink="/register" class="register-link">Regístrate</a>
        <a href="#" class="forgot-password-link">Recuperar contraseña</a>
      </div>
    </div>
    <div class="form-group">
      <div class="text-center">
        <button [disabled]="loginForm.invalid" type="submit" class="btn btn-primary">Iniciar sesión</button>
      </div>
    </div>
  </form>
</div>
